import React from 'react';
import './Shop.css';

const items = [
  { id: 1, name: 'Item 1', price: '$10', description: 'Description of Item 1' },
  { id: 2, name: 'Item 2', price: '$20', description: 'Description of Item 2' },
  { id: 3, name: 'Item 3', price: '$30', description: 'Description of Item 3' },
];

const Shop = () => {
  return (
    <div className="shop-container">
      <h1>Shop Page</h1>
      <div className="items-grid">
        {items.map(item => (
          <div key={item.id} className="item-card">
            <h2>{item.name}</h2>
            <p>{item.description}</p>
            <p className="price">{item.price}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Shop
